# Python Challenge Problem 3
# One small letter, surrounded by EXACTLY three big bodyguards on each
# of its sides.
# I think we have to search through the string and filter out only the
# lower-case letters in between 3 upper-case letters on either side. 
import re
import string

cString = ""

# find non-overlapping pattern 'XXXxXXX'
results = re.findall(r"[a-z][A-Z][A-Z][A-Z][a-z][A-Z][A-Z][A-Z][a-z]", cString)
counter = 0
for i in results:
    counter += 1
print(counter)

# convert list 'match' back to string
cString1 = ''.join(results)
print(cString1)

results1 = re.findall(r"[A-Z][A-Z][A-Z][a-z][A-Z][A-Z][A-Z]", cString1)
cString2 = ''.join(results1)

# filter out all upper-case letters from cString2
cleanStr = cString2.translate(None, string.uppercase)

print(cleanStr)
